import React from 'react';
import '../Components/Homepage.css';

const Homepage = () => {
  return (
    <div>
      <header>
        <nav className='navbar'>
          <div className='logo'>
            <img src='/download (1).png' alt='Medium' />
          </div>
          <div className='options'>
            <ul>
                <li>Our story</li>
                <li>Membership</li>
                <li>Write</li>
                <li>Sign in</li>
                <li></li>
            </ul>
          </div>
        </nav>
      </header>
    </div>
  );
};

export default Homepage;
